// import logo from './logo.svg';
// import './App.css';
import { useState, useEffect } from 'react';
import { HashRouter, Link, Switch, Route } from 'react-router-dom';
import './style.css';
import 'boxicons/css/boxicons.min.css';



function SideBar(props) {

    const sideBarItems = [
        {
            itemName: 'Home',
            itemIcon: (<i className='bx bx-grid-alt' ></i>),
            itemHyperLink: '/',
            subItems: []
        },
        {
            itemName: 'App1',
            itemIcon: (<i className='bx bx-collection' ></i>),
            itemHyperLink: '#',
            subItems: [
                {
                    subItemName: 'Dashboard KPI',
                    subItemHyperLink: '/App1'
                },
                {
                    subItemName: 'Detail',
                    subItemHyperLink: '/App2'
                }
            ]
        }
    ];


    useEffect(() => {
        let arrow = document.querySelectorAll(".arrow");
        for (var i = 0; i < arrow.length; i++) {
            arrow[i].addEventListener("click", (e) => {
                let arrowParent = e.target.parentElement.parentElement;//selecting main parent of arrow
                arrowParent.classList.toggle("showMenu");
            });
        }

        let sidebar = document.querySelector(".sidebar");
        let sidebarBtn = document.querySelector(".bx-menu");
        sidebarBtn.addEventListener("click", () => {
            sidebar.classList.toggle("close");
        });

        return () => {
            let arrow = document.querySelectorAll(".arrow");
            for (var i = 0; i < arrow.length; i++) {
                arrow[i].removeEventListener("click", (e) => {
                    let arrowParent = e.target.parentElement.parentElement;//selecting main parent of arrow
                    arrowParent.classList.toggle("showMenu");
                });
            }

            let sidebar = document.querySelector(".sidebar");
            let sidebarBtn = document.querySelector(".bx-menu");
            sidebarBtn.removeEventListener("click", () => {
                sidebar.classList.toggle("close");
            });
        };
    }, []);




    return (
        <>
            <div className="sidebar close">
                <div className="logo-details">
                    {/* <i className='bx bxl-c-plus-plus'></i> */}
                    <i className='bx bxs-hot'></i>
                    <span className="logo_name">HelloOnion</span>
                </div>
                <ul className="nav-links">
                    {
                        sideBarItems.map((item, index) => (
                            <li key={index}>
                                <div className="iocn-link">
                                    <a href={item.itemHyperLink}>
                                        {item.itemIcon}
                                        <span className="link_name">{item.itemName}</span>
                                    </a>
                                    <i className='bx bxs-chevron-down arrow' ></i>
                                </div>
                                <ul className="sub-menu">
                                    <li><a className="link_name" href="#">{item.itemName}</a></li>
                                    {
                                        item.subItems.map((subItem, index2) => {
                                            // <li key={index2}><Link to={subItem.subItemHyperLink}>{subItem.subItemName}</Link></li>
                                            <li key={index2}>{subItem.subItemName}</li>
                                        })
                                    }
                                </ul>
                            </li>
                        ))
                    }

                    <li>
                        <div className="profile-details">
                            <div className="profile-content">
                                {/* <img src="./image/profile.jpg" alt="profileImg" /> */}
                                <img src={require('./image/profile.png')} alt="profileImg" />
                            </div>
                            <div className="name-job">
                                <div className="profile_name">OnionTraveler</div>
                                <div className="job">Web Desginer</div>
                            </div>
                            <i className='bx bx-log-out' ></i>
                        </div>
                    </li>
                </ul>
            </div>
            <section className="home-section">
                <div className="home-content">
                    <i className='bx bx-menu' ></i>
                    <span className="text">Drop Down Sidebar</span>
                </div>
                <div>123</div>
                {props.children}
            </section>

        </>
    );
}

export default SideBar;
